import { Card, Typography } from '@material-ui/core'
import React from 'react'

const getMatchCart = () => {
    return (
        <><Card>
            <Typography>This is card</Typography>
        </Card>
        </>
    )
}

function MyCard() {
    return (
        <>
            <getMatchCart />
        </>
    )
}

export default MyCard
